    private final DisplayEntity theBike;

    public BikeVehicle(@Nonnull Player passenger) {
        super(passenger);

        this.maxHeight.set(0.5d);
        this.speed.set(0.3d);

        this.theBike = THE_BIKE.spawnInterpolated(passenger.getLocation());
    }

    @Override
    public void onMove() {
        final Location location = passenger.getLocation();
        location.subtract(0, 0.3, 0);
        location.setPitch(0.0f);
        location.setYaw(location.getYaw() + 180);

        theBike.teleport(location);
    }

    @Override
    public void remove() {
        super.remove();

        theBike.remove();
    }
